css:
atom-panel.bottom.termrk-panel {
  position: relative;
  width: 100%;
  box-sizing: content-box;
  border-top: 2px solid #21252b;
}
.termrk-container {
  width: 100%;
  height: 100%;
}
.termrk {
  position: relative;
  height: 300px;
  overflow: hidden;
}
.termrk *::selection {
  background: rgba(58, 63, 75, 0.99);
}
.termrk .terminal {
  display: inline-block;
  float: none !important;
  border: none;
  padding: 0 5px;
  overflow-y: hidden;
  overflow-x: hidden;
  height: 100%;
  line-height: calc(1em  + 2px);
  font-size: 14px;
  font-family: "Monospace";
  color: #f0f0f0;
  background-color: #000000;
}
.termrk .terminal > div {
  white-space: nowrap;
  height: calc(1em  + 2px);
  line-height: calc(1em  + 2px);
}
.termrk .terminal-cursor {
  color: #000000;
  background-color: #f0f0f0;
}
.termrk > input {
  position: absolute;
  z-index: -1;
  opacity: 0;
}
